import styled from 'styled-components';

const NavBar = () => {
    const Nav = styled.nav`
    display:grid;
    grid-template-columns: 100px 1fr 100px;`
    return <Nav>
        <Logo />
        <SearchBar />
        <User />
    </Nav>

}

export default NavBar
